import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [imageUrl, setImageUrl] = useState('');

  const fetchRandomImage = () => {
    fetch('https://picsum.photos/200/300')
      .then((response) => {
        if (response.ok) {
          setImageUrl(response.url);
        } else {
          console.error('Erro ao buscar a imagem da API Picsum Photos');
        }
      })
      .catch((error) => {
        console.error('Erro ao buscar a imagem da API Picsum Photos:', error);
      });
  };

  useEffect(() => {
    fetchRandomImage();
  }, []);

  return (
    <div className="App">
      <h1>Imagem da API Picsum Photos</h1>
      <img src={imageUrl} alt="Imagem da API Picsum Photos" />
      <button onClick={fetchRandomImage}>Buscar Nova Imagem</button>
    </div>
  );
}

export default App;
